import ExpenseItem from "./ExpenseItem";
import './Expenses.css';

function Expenses(props) {

    return (
        <div>
            <ExpenseItem
                date={props.expenses.date}
                title={props.expenses.title}
                amount={props.expenses.amount}
            ></ExpenseItem>   
        </div>
    )
}

export default Expenses;
